import React, {Component} from "react";
import "../css/newPayment.css";

export default class NewPayment extends Component {

// Konstruktor /////////////////////////////////////////////////////////////////////

// Získání dat ////////////////////////////////////////////////////////////////////

    componentDidMount() {
        document.title = "Přehled | Web Bank";
    }

// Vykreslení /////////////////////////////////////////////////////////////////////

    render() {

        return(
            <div id="newPaymentContainer">
                <div id="newPayment">
                    <div>{this.props.userID}</div>
                </div>
            </div>
        )
    }
}
